import React from 'react';
import styled from 'styled-components';


interface menuItemsPropsType {
  name: string;
  link: string;
  id: any;
}

export const Menu: React.FC<menuItems[]> = (props) => {
  return (
    <StyledMenu >
        <ul>
          <li>
            <a href="">Home</a>
          </li>
          <li>
            <a href="">About me</a>
          </li>
          <li>
            <a href="">My skills</a>
          </li>
          <li>
            <a href="">Projects</a>
          </li>
          <li>
            <a href="">Contacts</a>
          </li>
        </ul>
      </StyledMenu>
  );
};

const StyledMenu = styled.nav`
  ul {
    display: flex;
    gap: 52px;
  }
`
